import React, { Component } from 'react';
import './button-styles.css';

class Button extends Component {
  render() {
    return (
      <div className="button col-md-1 h-25  d-flex justify-content-center align-items-center bg-dark text-white border">
        {this.props.children}
      </div>
    );
  }
}

export default Button;
